import React from "react";
import Sidebar from '../components/sidebar';
import Footer from '../components/footer';
import { Container } from "react-bootstrap";


const Dashboard = () => {

    return (
      <div>
        <Container>
          <Sidebar/>
        </Container>
        <Footer/>
      </div>
      
    );
  };
  
  export default Dashboard;
